export default function CookiesList() {
    const cookies = [
        'Strawberry Cookie',
        'Gingerbrave',
        'Muscle Cookie',
        'Wizard Cookie',
        'Beet Cookie',
        'Angel Cookie'
    ]

    return cookies;
}
